import React, { Component } from 'react'

export default class Timer extends Component {
  render() {
    var timer;
    const resetTimer = () => timer = 3000
    const countDown = setInterval(() => timer -= 1, 1000)
    resetTimer()
    countDown()
    return (
      <div className="timer">
        { timer } 
      </div>
    )
  }
}
